import React from "react";
import Styles from "./UI/styles.module.css";
import { IToDo } from "../../app/models/models";

export function ToDo(props:IToDo) {
	return (
		<div className={Styles.container}>
			<h3 className={Styles.toDoH3}>{props.title}</h3>
			<p className={Styles.toDoP}>{props.description}</p>
		</div>
	);
}
